collation_table make_save_load_table()
{
#ifdef LIMIT_TESTING_FOR_CI
    std::string const table_str(data::ko::standard_collation_tailoring());
    return tailored_collation_table(
        table_str,
        "ko::standard_collation_tailoring()", error, warning);
#else
    if (!exists(boost::filesystem::path("ko_standard.table"))) {
        std::string const table_str(data::ko::standard_collation_tailoring());
        collation_table table = tailored_collation_table(
            table_str,
            "ko::standard_collation_tailoring()", error, warning);
        save_table(table, "ko_standard.table.4");
        boost::filesystem::rename("ko_standard.table.4", "ko_standard.table");
    }
    return load_table("ko_standard.table");
#endif
}
